import React, { Component } from 'react';
import logo from './logo.svg';
import './App.css';

class App extends Component {
  constructor() {
    super();

    this.state = {
      price: [],
    };

    this.onGetStockPrice = this.onGetStockPrice.bind(this);
  }

  onGetStockPrice() {
    fetch("https://www.alphavantage.co/query?function=TIME_SERIES_INTRADAY&symbol=MSFT&interval=5min&apikey=demo", {
      method: 'GET',
      headers: {
        Accept: 'application/json'
      }
    })
      .then(response => response.json())
      .then(json => {
        const price = json['Time Series (5min)'];
        this.setState({
          price
        });
      })
  }


  render() {
    return (
      <div className="App">
        <header className="App-header">
          <img src={logo} className="App-logo" alt="logo" />
          <a
            href = "http://localhost:8000"
            target="_blank"
            > Get Today's Stock Price</a>
              <input
                id = "ticker-input"
                type="text"
                placeholder="Enter search ticker..."
              />
              <div>
                <button onClick={this.onGetStockPrice}>Today's Stock Price</button>;
              </div>
        </header>
      </div>
    );
  }

}

export default App;
